import React from "react";
import { GoogleOAuthProvider, GoogleLogin } from "@react-oauth/google";
import jwtdecode from 'jwt-decode';
const LoginPage = () => {
  // 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
//   apikey AIzaSyDLiFPNW9LQOrhWPacgdjTt5fD-xVf_LBc
  return (
    <section className="max-container my-12">
      <GoogleOAuthProvider clientId="911969724281-vaai2vlk1acs2aarntt8mnlbgirb3h0c.apps.googleusercontent.com">

        <GoogleLogin
          onSuccess={(credentialResponse) => {
            const details = jwtdecode(credentialResponse.credential);
            console.log(details)
            console.log(credentialResponse);
          }}
          onError={() => {
            console.log("Login Failed");
          }}
          useOneTap
        />

      </GoogleOAuthProvider>
    </section>
  );
};

export default LoginPage;
